import React, { useEffect, useState, useCallback, useMemo } from 'react';
import Box from '@mui/material/Box';
import Typography from '@mui/material/Typography';
import { createTheme } from '@mui/material/styles';
import DescriptionIcon from '@mui/icons-material/Description';
import PersonIcon from '@mui/icons-material/Person';
import LockIcon from '@mui/icons-material/Lock';
import SecurityIcon from '@mui/icons-material/Security';
import { AppProvider } from '@toolpad/core/AppProvider';
import { DashboardLayout } from '@toolpad/core/DashboardLayout';
import { useNavigate, useLocation, useSearchParams } from 'react-router-dom';
import axios from 'axios';
import { jwtDecode } from 'jwt-decode';
import UsuarioForm from '../pages/Seguridad/usuario';

const demoTheme = createTheme({
    palette: {
        mode: 'light',
    },
});

const iconMap = {
    Seguridad: <SecurityIcon />,
    Roles: <DescriptionIcon />,
    Usuarios: <PersonIcon />,
    Permisos: <LockIcon />,
};

const DefaultIcon = <DescriptionIcon />; // Icono por defecto

export default function DashboardLayoutNavigationLinks() {
    const navigate = useNavigate();
    const location = useLocation();
    const pathname = location.pathname;
    const [searchParams] = useSearchParams();
    const [menuItems, setMenuItems] = useState([]);
    const [currentComponent, setCurrentComponent] = useState(null);
    const [loading, setLoading] = useState(true);
    const isAuthenticated = Boolean(localStorage.getItem('token'));

    const fetchMenus = useCallback(async () => {
        setLoading(true);
        const token = localStorage.getItem('token');
        if (!token) {
            setLoading(false);
            return;
        }

        const decoded = jwtDecode(token);
        const username = decoded.user.username;

        try {
            const response = await axios.get(`http://localhost:5000/api/navigation/menu/${username}`);
            setMenuItems(response.data);
        } catch (error) {
            console.error('Error fetching menus:', error);
            // Aquí podrías mostrar un mensaje al usuario si lo deseas
        } finally {
            setLoading(false);
        }
    }, []);

    useEffect(() => {
        if (!isAuthenticated) {
            navigate('/login');
        } else {
            fetchMenus();
        }
    }, [isAuthenticated, fetchMenus, navigate]);

    const navigation = useMemo(() => {
        return menuItems.map(item => {
            if (item.ParentMenuID === 0) {
                const icon = iconMap[item.DisplayName] || DefaultIcon;
                return {
                    segment: item.DisplayName,
                    title: item.DisplayName,
                    icon: icon,
                    children: menuItems.filter(subItem => subItem.ParentMenuID === item.MenuID),
                    onClick: () => {
                        if (!isAuthenticated) {
                            navigate('/login');
                            return;
                        }
                        if (item.DisplayName.toLowerCase() === 'usuarios') {
                            setCurrentComponent(<UsuarioForm />);
                        } else {
                            navigate(item.MenuURL);
                            setCurrentComponent(null);
                        }
                    },
                };
            }
            return null;
        }).filter(Boolean);
    }, [menuItems, isAuthenticated, navigate]);

    return (
        <AppProvider
            navigation={navigation.map(item => ({
                segment: item.segment,
                title: item.title,
                icon: item.icon,
                children: item.children.length > 0 ? item.children.map(subItem => ({
                    segment: subItem.DisplayName,
                    title: subItem.DisplayName,
                    icon: iconMap[subItem.DisplayName] || DefaultIcon,
                    onClick: item.onClick,
                })) : [],
            }))}
            router={{
                pathname,
                navigate: (path) => navigate(path),
                searchParams,
            }}
            theme={demoTheme}
        >
            <DashboardLayout>
                {loading ? (
                    <Typography variant="h6">Cargando...</Typography>
                ) : (
                    currentComponent || <DemoPageContent pathname={pathname} />
                )}
            </DashboardLayout>
        </AppProvider>
    );
}

function DemoPageContent() {
    return (
        <Box
            sx={{
                py: 35,
                display: 'flex',
                flexDirection: 'column',
                alignItems: 'center',
                textAlign: 'center',
            }}
        >
            <Typography variant="h4">Bienvenido al Gestor de Control de Calidad!</Typography>
        </Box>
    );
}
